import React, { Component, useEffect, useState} from "react";
import { Link } from "react-router-dom";


export default function AdminDashboard({ userData }) {
  //const {useData} = userData.userData;

  const logOut = () => {
    window.localStorage.clear();
    window.location.href = "./sign-in";
  };



  return (
    <div>
      <h1>Admin Dashboard</h1>
      <nav>
        <ul>
          <li>
            <Link to="/getAllUsers">View Users</Link>
          </li>
          <li>
            Name<h1>{userData.fname}</h1>
            Last<h1>{userData.lname}</h1>
            Email<h1>{userData.email}</h1>
            UserType<h1>{userData.userType}</h1>
            Password<h1>{userData._id}</h1>
            <Link className="btn btn-primary" to="/updateProfile/:id" state={userData
            } >
              Update Profile
            </Link>
          </li>
          <span>Hi</span>
        </ul>
      </nav>
      <button onClick={logOut} className="btn btn-primary">
        Log Out
      </button>
      
    </div>
  );
}
